import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "./PagePet.css";
import { Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const PetPage = () => {
  const [listpets, setListpets] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchPetList();
  }, []);

  const fetchPetList = async () => {
    try {
      const resultpets = await axios.get("http://localhost:8110/api/pet/get");
      setListpets(resultpets.data);
    } catch (error) {
      console.error(error);
    }
  };

  const deletePet = async (idPet) => {
    try {
      const resultPet = await axios.delete(
        `http://localhost:8110/api/pet/deletePet/${idPet}`
      );

      if (resultPet.status === 200) {
        const updatedpets = listpets.filter(
          (pet) => pet._id !== idPet
        );
        setListpets(updatedpets);
        alert("Mascota eliminada correctamente");
      } else {
        alert("Error al eliminar la mascota");
      }
    } catch (error) {
      console.error(error);
    }
  };

  const addPet = () => {
    navigate("/pets/addPet");
  };

  const detailPet = (idPet) => {
    navigate(`/pets/detailPet/${idPet}`);
  };

  const reviewPet = (idPet) => {
    navigate(`/reviews/${idPet}`);
  };

  const navigateToCrewBoard = () => {
    navigate("/pets");
  };

  return (
    <div>
      <div>
        <div className="header">
          <h1>Lista de Mascotas</h1>
          <div className="buttonHeader">
            <Button variant="contained" onClick={navigateToCrewBoard}>
              Crew Board
            </Button>
            <Button variant="contained" onClick={addPet}>
              Agregar Mascota
            </Button>
          </div>
        </div>
        <div className="containerList">
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Name</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Action</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {listpets.map((pet, index) => (
                  <TableRow key={index}>
                    <TableCell>{pet.name}</TableCell>
                    <TableCell>{pet.type}</TableCell>
                    <TableCell>
                      <Button variant="outlined" onClick={() => detailPet(pet._id)}>
                        Ver Mascota
                      </Button>
                      <Button variant="outlined" onClick={() => deletePet(pet._id)}>
                        Eliminar Mascota
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </div>
      </div>
    </div>
  );
};

export default PetPage;
